import './App.css';
import Sidebar from './components/sidebar/sidebar';
import Home from './pages/home/home';

function App() {
  return (
    <div className="App">
      <Home />
      <Sidebar />
      <Router>
      <div>
        <Switch>
          <Route exact path="/" />
          <Route path="/about" />
          <Route path="/contact" component={Contact} />
        </Switch>
      </div>
    </Router>
    </div>
  );
}

export default App;
